import React from "react";
import { createPath } from "react-router-dom";

export default function Colors(props) {
	const colors = {
    'Burnt Sienna': '#EF5350',
		'French Rose': '#EC407A',
		'Amethyst': '#AB47BC',
		'Fuchsia Blue': '#7E57C2',
		'Indigo': '#5C6BC0',
		'Picton Blue': '#42A5F5'
  }

	function ColorsList() {
		let colorSelects = [];
		for (const color in colors) {
			console.log(color)
			colorSelects.push(
				<p>{color}</p>
			)
		}
		return colorSelects;
	}

	return (
		<div className="form-group">
			{ColorsList()}
		</div>
	)
}
